/** @format */

import "./App.css";
import { Link, Route } from "react-router-dom";
import styles from "./To_mn.module.css";
import Main from "./page/Main.js";

function App() {
  return (
    <div>
      <header>
        <div className={styles.Top_mn_body}>
          <div className={styles.Top_mn_logo}>
            <Link to="/">Laftel</Link>
          </div>
          <div className={styles.Top_mn_menu}>
            <Link to="/finder">태그검색</Link>
            <Link to="/daily">요일별 신작</Link>
            <Link to="/themes">테마추천</Link>
            <Link to="/membership">멤버쉽</Link>
          </div>
          <div className={styles.Top_mn_login}></div>
        </div>
      </header>
      <Main />
      <div>
        <Route path="/"></Route>
        <Route path="/finder"></Route>
        <Route path="/daily"></Route>
        <Route path="/themes"></Route>
        <Route path="/membership"></Route>
      </div>
    </div>
  );
}

export default App;
